import React, { useState } from 'react';

const API_ENDPOINT = "https://sgt69sh0da.execute-api.us-east-1.amazonaws.com/prod";

function Display() {
  const [profileData, setProfileData] = useState([]);

  const handleGetProfile = () => {
    fetch(API_ENDPOINT)
      .then(response => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then(data => {
        setProfileData(data);
      })
      .catch(error => {
        console.error('There was a problem with the fetch operation:', error);
      });
  };

  return (
    <div>
      <input type="button" id="getprofile" value="View all the Student Resumes" onClick={handleGetProfile} />
      <br />
      <div id="showProfile">
        <table id="Profile">
          <colgroup>
            <col style={{ width: '20%' }} />
            <col style={{ width: '20%' }} />
            <col style={{ width: '20%' }} />
            <col style={{ width: '20%' }} />
          </colgroup>
          <tbody>
            <tr>
              <th>Student ID</th>
              <th>File name</th>
              <th>Uploaded Time</th>
              <th>File Link</th>
            </tr>
            {profileData.map(profile => (
              <tr key={profile.ID}>
                <td>{profile.ID}</td>
                <td>{profile.fileId}</td>
                <td>{profile.uploadedAt}</td>
                <td>{profile.s3Location}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Display;
